class CiscoProbeHealthMonState(TextualConvention, Integer32):
    description = "The health monitor state of the probe for a server. The possible values are : 'other' : The health monitor state of the probe when none of the other values apply. 'invalid' : Server is not being monitored. Although user has tried to associate the probe to the server, but due to some internal problem it is actually not associated. 'init' : server is configured but not tested. 'active' : server is active. All expected responses received. 'failed' : probe has failed as expected responses have failed beyond acceptable limits. 'disabled' : probe disabled due to server being outofservice or no valid ip address configured to server."
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6))
    namedValues = NamedValues(("other", 1), ("invalid", 2), ("init", 3), ("active", 4), ("failed", 5), ("disabled", 6))

class CiscoProbeInheritedPortType(TextualConvention, Integer32):
    description = "The type of the inheritance for the probe port. The possible values are : 'other' : The inherited port when none of the other values apply. 'probe' : The inherited port is the probe's configured port. 'real' : The inherited port is the port of the real server to which the probe is associated. 'vip' : The inherited port is the port of the virtual ip address. 'default' : The inherited port is the probe's default port."
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))
    namedValues = NamedValues(("other", 1), ("probe", 2), ("real", 3), ("vip", 4), ("default", 5))

